import React from 'react'


import { 
    Link
   } from 'react-router-dom'

export default class Main_Menu_Modal extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            displayITServicesSubMenu: 'none', underLineColorHome: null, underLineColorAboutUs: null, underLineColorTechWeUse: null, 
            underLineColorIndWeServe: null, underLineColorAchieve: null, underLineColorSuccess: null, 
            underLineColorBlog: null, underLineColorFAQs: null, underLineColorTerms: null, underLineColorContact: null, 
            underLineColorCloudAutomation: null,  underLineColorDataAnalytics: null, underLineColorDigiTran: null, 
            underLineColorMarkTran: null
          
        }
      this.ITServices = this.ITServices.bind(this)
      this.closeSubMenu = this.closeSubMenu.bind(this)
      this.putUnderLineColorHome = this.putUnderLineColorHome.bind(this)
      this.unputUnderLineColorHome = this.unputUnderLineColorHome.bind(this)
      this.putUnderLineColorAboutUs = this.putUnderLineColorAboutUs.bind(this)
      this.unputUnderLineColorAboutUs = this.unputUnderLineColorAboutUs.bind(this)
      this.putUnderLineColorTechWeUse = this.putUnderLineColorTechWeUse.bind(this)
      this.unputUnderLineColorTechWeUse = this.unputUnderLineColorTechWeUse.bind(this)
      this.putUnderLineColorIndWeServe = this.putUnderLineColorIndWeServe.bind(this)
      this.unputUnderLineColorIndWeServe = this.unputUnderLineColorIndWeServe.bind(this)
      this.putUnderLineColorAchieve = this.putUnderLineColorAchieve.bind(this)
      this.unputUnderLineColorAchieve = this.unputUnderLineColorAchieve.bind(this)
      this.putUnderLineColorSuccess = this.putUnderLineColorSuccess.bind(this)
      this.unputUnderLineColorSuccess = this.unputUnderLineColorSuccess.bind(this)
      this.putUnderLineColorBlog = this.putUnderLineColorBlog.bind(this)
      this.unputUnderLineColorBlog = this.unputUnderLineColorBlog.bind(this)
      this.putUnderLineColorFAQs = this.putUnderLineColorFAQs.bind(this)
      this.unputUnderLineColorFAQs = this.unputUnderLineColorFAQs.bind(this)
      this.putUnderLineColorTerms = this.putUnderLineColorTerms.bind(this)
      this.unputUnderLineColorTerms = this.unputUnderLineColorTerms.bind(this)
      this.putUnderLineColorContact = this.putUnderLineColorContact.bind(this)
      this.unputUnderLineColorContact = this.unputUnderLineColorContact.bind(this)

      this.putUnderLineColorCloudAutomation = this.putUnderLineColorCloudAutomation.bind(this)
      this.unputUnderLineColorCloudAutomation = this.unputUnderLineColorCloudAutomation.bind(this)
      this.putUnderLineColorDataAnalytics = this.putUnderLineColorDataAnalytics.bind(this)
      this.unputUnderLineColorDataAnalytics = this.unputUnderLineColorDataAnalytics.bind(this)
      this.putUnderLineColorDigiTran = this.putUnderLineColorDigiTran.bind(this)
      this.unputUnderLineColorDigiTran = this.unputUnderLineColorDigiTran.bind(this)
      this.putUnderLineColorMarkTran = this.putUnderLineColorMarkTran.bind(this)
      this.unputUnderLineColorMarkTran = this.unputUnderLineColorMarkTran.bind(this)

     this.closeMainMenu = this.closeMainMenu.bind(this)
     
    }
